      FOAF is a vocabulary for representing people and organizations on the web using
      RDF. It provides a set of properties that can be used to describe different
      aspects of these entities, such as their names, affiliations, contact information,
      and skills.


      In this example, we have created a turtle file that uses the FOAF vocabulary
      to represent three individuals: Anne Miller, Bob Tanner, and the Chief Research
      Office. Each individual is represented using an `@prefix` declaration for the
      namespace of the vocabulary they belong to, followed by their full name and
      any other relevant properties.


      The `@prefix` declarations specify the namespace for each type of property used
      in the file. For example, the `@prefix` declaration for the `foaf` namespace
      is `foaf`, while the `@prefix` declaration for the `org` namespace is `org`.


      The `@prefix` declarations are followed by the full names of the individuals,
      with their first names and last names separated by a colon. For example, the
      full name of Anne Miller is `Anne Miller`, while the full name of Bob Tanner
      is `Bob Tanner`.


      The `@prefix` declarations are also followed by the properties that describe
      each individual. For example, the `@prefix` declaration for the `foaf` namespace
      is `foaf`, while the `@prefix` declaration for the `org` namespace is `org`.


      The `@prefix` declarations are followed by the properties themselves, with their
      names and values separated by a colon. For example, the property `foaf:firstName`
      has a value of `Anne` for Anne Miller, while the property `org:unitOf` has a
      value of `wonderOrg` for the Chief Research Office.


